import React from "react";
import SumBills from "./SumBills";
import SumContracts from "./SumContracts";
import Sum from "./SumAll";

const HomeContainer = props => {
  return (
    <div className="HomeContainer">
      <Sum title="Gesamtkosten über alle Dokumente:" bills={props.bills} contracts={props.contracts}/>
      <SumBills title="Gesamtkosten Rechnungen:" bills={props.bills} />
      <SumContracts title="Gesamtkosten Verträge:" contracts={props.contracts}/>
    </div>
  );
};

export default HomeContainer;
